INSERT INTO `announcements` VALUES (1, '公告', '尊敬的各位同事：\n为了更好地推动公司的发展，提升工作效率和员工福利，我们将进行以下几项重要调整和更新，请大家注意：\n年度考核及奖励发放\n根据公司的年度业绩评估，所有员工的年度考核结果将在12月15日公布。公司将依据考核结果发放年度奖金和奖品，具体细节请查看即将发布的考核通知。\n办公环境优化\n公司将在下个月开始进行办公区域的升级和改造工作，包括员工休息区的扩建与设备更新。预计改造工作将在1月初完成，届时将为大家提供更加舒适和现代化的办公环境。\n健康福利计划\n为了提高员工的健康保障，公司将从明年起为所有正式员工提供补充医疗保险。同时，我们将定期举办健康讲座和健身活动，帮助员工保持健康的生活方式。\n年终聚会通知\n为了感谢大家一年来的辛勤工作，公司将在12月22日举办年终聚会。届时，我们将安排精彩的节目和抽奖活动，诚邀各位同事积极参加。\n希望大家能继续保持积极的工作态度，共同推动公司迈向更高的目标。如有任何疑问或建议，欢迎随时与人力资源部门联系。\n感谢大家一年的辛勤付出，期待与大家在即将到来的新的一年中继续携手并肩，共同迎接新的挑战。\n祝大家工作顺利，生活愉快！\n\n此致\n敬礼\n\n公司人力资源部\n2024年12月6日', '2006-04-08 03:38:21', '2024-12-06 14:01:47');
