-- ----------------------------
-- Table structure for emails
-- ----------------------------
DROP TABLE IF EXISTS `emails`;
CREATE TABLE `emails`  (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '邮件唯一标识',
  `sender_id` int NOT NULL COMMENT '发件人ID',
  `receiver_id` int NOT NULL COMMENT '收件人ID',
  `subject` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '邮件主题',
  `content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '邮件内容',
  `send_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '邮件发送时间',
  `status` enum('未读','已读','已删除') CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '未读' COMMENT '邮件状态',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `sender_id`(`sender_id` ASC) USING BTREE,
  INDEX `receiver_id`(`receiver_id` ASC) USING BTREE,
  CONSTRAINT `emails_ibfk_1` FOREIGN KEY (`sender_id`) REFERENCES `staff` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `emails_ibfk_2` FOREIGN KEY (`receiver_id`) REFERENCES `staff` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 41 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '邮件表\r\n用于存储内部邮件管理模块中的邮件信息。' ROW_FORMAT = Dynamic;

