-- ----------------------------
-- Table structure for feedback
-- ----------------------------
DROP TABLE IF EXISTS `feedback`;
CREATE TABLE `feedback`  (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '意见唯一标识',
  `user_id` int NOT NULL COMMENT '用户ID',
  `suggestion` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '意见或建议内容',
  `status` enum('未处理','已处理') CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '未处理' COMMENT '意见状态',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '提交时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `user_id`(`user_id` ASC) USING BTREE,
  CONSTRAINT `feedback_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `staff` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 29 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '反馈表\r\n用于存储意见管理模块中的用户反馈或建议。' ROW_FORMAT = Dynamic;

